import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Container, Row, Col } from 'react-bootstrap';
const Header = () => {
    return (
        <Row>
            <div className="head-block coll-12">
            <h1>
                HELLO WORLD MF
            </h1>
            </div>
        </Row>
    );
}
export default Header;
